import styled from "styled-components";

export const StyledBoxModal = styled.div`
    min-width: 100vw;
    min-height: 100vh;

    position: fixed;
    top: 0%;

    display: flex;
    justify-content: center;
    align-items: center;

    background: rgba(0, 0, 0, 0.5);
`;
